import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";

function Card() {
  return <div className="cards">react를 배워봅시다</div>;
}

function App() {
  const [insert, setInsert] = useState("");
  return (
    <>
      <input
        value={insert}
        placeholder="무엇을 할까요?"
        onChange={(e) => setInsert(e.target.value)}
      />
      <button>추가하기</button>
      <h1 className="App">Todo List</h1>;
      <Card />
    </>
  );
}

export default App;
